import axios from 'axios';
import storageServices from '@/service/storageService';

const service = axios.create({
    baseURL: process.env.VUE_APP_BASE_URL,
    timeout: 1000 * 5,
    headers: { Authorization: `Bearer${storageService.get(storageServices.USER_TOKEN)}` },
});

export default service;
